import { Outlet, Route, Routes, useParams } from "react-router-dom"
import FormSt from "./component/FormSt"
import NavBar from "./component/Navigation"
import Students from "./component/Students"

function RouteMain() {
    const params = useParams()
    console.log(params);
    const btnAdd = { class: "success", name: "Add" }
    const btnUpdate = { class: "info", name: "Update" }
    return <div>
        <NavBar />
        <Routes>
            <Route path="/students" element={<Students />} />
            <Route path={"/form"} element={<FormSt btn={btnAdd} />} />
            <Route path="/form/:id" element={<FormSt btn={btnUpdate} />} />
        </Routes>
        <Outlet></Outlet>
    </div>
}
export default RouteMain
